import React, { useState } from "react";

const units = ["mm", "cm", "m", "km", "mi", "ft", "in"];

const realWorldItems = [
  { name: "Hydrogen Atom", volume: 6.5e-31 },
  { name: "Red Blood Cell", volume: 9e-17 },
  { name: "Coffee Cup", volume: 2e-4 },
  { name: "Milk Carton", volume: 1e-3 },
  { name: "Swimming Pool", volume: 2500 },
  { name: "Mount Everest", volume: 5.2e13 },
];

function UnitConversionColumn({ fromUnit }) {
  return (
    <div className="space-y-2 border rounded p-2 text-sm bg-white shadow-sm">
      {units.map((unit) => (
        <div
          key={unit}
          className={`p-1 rounded ${unit === fromUnit ? "bg-blue-100 font-semibold text-blue-800" : "text-gray-700"}`}
        >
          {unit}
        </div>
      ))}
    </div>
  );
}

function ComparisonColumn({ fromValueM3, item }) {
  const result = fromValueM3 && item.volume ? fromValueM3 / item.volume : null;
  const format = (n) =>
    n ? Number(n).toExponential(2).replace("e+", "×10^").replace("e", "×10^") : "-";

  return (
    <div className="border rounded p-3 text-center bg-white shadow-sm">
      <div className="text-xl font-bold text-blue-600 mb-1">
        {format(result)}
      </div>
      <div className="text-sm text-gray-700">{item.name}</div>
      <div className="text-xs text-gray-500 mt-1">
        Volume: {format(item.volume)} m³
      </div>
    </div>
  );
}

export default function StructuredComparison() {
  const [fromValue, setFromValue] = useState(1);
  const [fromUnit, setFromUnit] = useState("L");

  // Convert to m³ for comparison
  const unitToM3 = {
    mm: 1e-9,
    cm: 1e-6,
    m: 1,
    km: 1e9,
    mi: 4.168e9,
    ft: 0.0283168,
    in: 1.6387e-5,
    L: 0.001,
  };
  const fromValueM3 = fromValue * (unitToM3[fromUnit] || 1);

  return (
    <div className="max-w-7xl mx-auto p-6 space-y-8">
      <h2 className="text-2xl font-bold text-center mb-4">Volume Converter</h2>

      {/* From Input */}
      <div className="flex flex-col md:flex-row gap-4 justify-center items-center">
        <input
          type="number"
          value={fromValue}
          onChange={(e) => setFromValue(e.target.value)}
          className="border p-2 rounded w-40"
          placeholder="Enter value"
        />
        <select
          value={fromUnit}
          onChange={(e) => setFromUnit(e.target.value)}
          className="border p-2 rounded w-40"
        >
          {units.concat("L").map((unit) => (
            <option key={unit}>{unit}</option>
          ))}
        </select>
      </div>

      {/* Convert To Section */}
      <div>
        <h3 className="text-lg font-semibold text-center mb-3">Convert To</h3>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          <UnitConversionColumn fromUnit={fromUnit} />
          <UnitConversionColumn fromUnit={fromUnit} />
          <UnitConversionColumn fromUnit={fromUnit} />
        </div>
      </div>

      {/* Compare To Section */}
      <div>
        <h3 className="text-lg font-semibold text-center mb-3">Compare To</h3>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          <ComparisonColumn fromValueM3={fromValueM3} item={realWorldItems[0]} />
          <ComparisonColumn fromValueM3={fromValueM3} item={realWorldItems[3]} />
          <ComparisonColumn fromValueM3={fromValueM3} item={realWorldItems[4]} />
        </div>
      </div>
    </div>
  );
}
